import React from "react";
import SportCard from "../components/SportCard";

export default function Category({ books }) {
  return (
    <>
      <h2>Sports</h2>
      {books && (
        <div className="card-list">
          {books.map((book) => (
            <SportCard
              src={book.src}
              bookName={book.bookName}
              author={book.author}
            />
          ))}
        </div>
      )}
    </>
  );
}
